import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import { LoginForm, SignupForm } from './components/Auth';
import { Calendar, BookingForm } from './components/Appointment';
import { AppointmentList, AdminPanel } from './components/AppointmentManagement';
import { Menu } from 'lucide-react';
import { useState } from 'react';

const Navbar = () => {
  const token = localStorage.getItem('token');
  const isAdmin = localStorage.getItem('is_admin') === 'true';
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('is_admin');
    window.location.href = '/login';
  };

  return (
    <nav className="bg-blue-600 p-4 fixed w-full top-0 z-10">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        <div className="text-white font-bold text-xl">Appointment System</div>
        <button className="lg:hidden text-white" onClick={() => setIsMenuOpen(!isMenuOpen)}>
          <Menu size={24} />
        </button>
        <div className="hidden lg:flex space-x-4">
          <Link to="/" className="text-white hover:text-blue-200">Home</Link>
          {token ? (
            <>
              <Link to="/dashboard" className="text-white hover:text-blue-200">Dashboard</Link>
              <Link to="/appointments" className="text-white hover:text-blue-200">Appointments</Link>
              {isAdmin && <Link to="/admin" className="text-white hover:text-blue-200">Admin</Link>}
              <button onClick={handleLogout} className="text-white hover:text-blue-200">Logout</button>
            </>
          ) : (
            <>
              <Link to="/login" className="text-white hover:text-blue-200">Login</Link>
              <Link to="/signup" className="text-white hover:text-blue-200">Sign Up</Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

const Home = () => {
  return (
    <div className="relative h-screen flex flex-col justify-center items-center text-white text-center px-4"
         style={{
           backgroundImage: "url('https://source.unsplash.com/1600x900/?nature,relax')",
           backgroundSize: 'cover',
           backgroundPosition: 'center',
           animation: "bgFade 10s infinite alternate"
         }}>
      <h1 className="text-4xl font-bold mb-4">Welcome to Our Appointment Booking System</h1>
      <p className="text-lg mb-6">Book your appointments easily and conveniently.</p>
      <Link to="/appointmentbooking" className="bg-blue-600 px-6 py-2 rounded-lg hover:bg-blue-800 transition">
        Book an Appointment
      </Link>
    </div>
  );
};

const Footer = () => {
  return (
    <footer className="bg-gray-800 text-white text-center p-4 fixed bottom-0 w-full">
      &copy; {new Date().getFullYear()} All Rights Reserved.
    </footer>
  );
};

const App = () => {
  return (
    <Router>
      <Navbar />
      <div className="pt-16"> {/* Push content below navbar */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/signup" element={<SignupForm />} />
          <Route path="/appointmentbooking" element={<BookingForm />} />
          <Route path="/appointments" element={<AppointmentList />} />
          <Route path="/admin" element={<AdminPanel />} />
        </Routes>
      </div>
      <Footer />
    </Router>
  );
};

export default App;
